import styled from 'styled-components/native'

export const Container = styled.View`
  flex: 1;
  padding-top: 20px;
`

export const Image = styled.ImageBackground`
  flex: 1;
  width: null;
`

export const InfoArea = styled.View`
  flex: 1;
  flex-direction: row;
  margin-top: 50px;
`

export const Area = styled.View`
  flex: 1;
  align-items: center;
`

export const Titulo = styled.Text`
  color: #45b2fc;
`

export const Dado = styled.Text`
  color: #2b4274;
  font-size: 20px;
  font-weight: 600;
  margin-top: 5px;
`

export const PctArea = styled.View`
  flex: 1;
  align-items: center;
`

export const PctTexto = styled.Text`
  color: #fff;
  font-size: 70px;
  background-color: transparent;
  margin-top: -100px;
`

export const Button = styled.Button`
  color: #45b2fc;
`
